import React from 'react'

function Rating({value, text, color}) {
  return (
    <div className='rating'>
        <span>
            <i style={{color}} className={
                value >= 1
                ? 'fas fa-start'
                : value >= 0.5
                    ? 'fas fa-star-halt'
                    : 'fas fa-start'
            }>
            </i>
        </span>

    </div>
  )
}

export default Rating
